import Home from '~/pages/Home';
import Following from '~/pages/Following';

// Public routes
const publicRoutes = [
    { patch: '/', component: Home },
    { patch: '/following', component: Following },
];

const privateRoutes = [];

export { publicRoutes, privateRoutes };
